import React, { Component } from 'react'
import './MenuItems.js'

import './Navbar.css'

class Navbar extends Component{
    render(){
        const MenuItems = [
            {
                title: 'Home',
                url: '#',
                cName: 'nav-links'
            },
            {
                title: 'Services',
                url: '#',
                cName: 'nav-links'
            },
            {
                title: 'Products',
                url: '#',
                cName: 'nav-links'
            },
            {
                title: 'Contact Us',
                url: '#',
                cName: 'nav-links'
            },
            {
                title: 'Sign Up',
                url: '#',
                cName: 'nav-links'
            }
        ]
        return(
            <nav className = 'NavbarItems'>
                <h1 className ='navbar-logo'>React<i className='fan fa-react'></i></h1>
                <div className = 'menu-icon'>
                    
                </div>
                <ul>
                    {MenuItems.menuList.map((item, index) => {
                        return(
                            <li key = {index}>
                                <a className = {item.cName} href = {item.url}>
                                    {item.title}
                                </a>
                            </li>
                        )
                    })}
                </ul>
            </nav>
        )
    }
}

export default Navbar
